layout_global_auto_inc.statement:
BEGIN
		IF (@zDisableTriggers IS NULL) THEN
			IF (NEW.`layout_global_id` > 0) THEN
				SET @zLastInsertId = NEW.`layout_global_id`;
			ELSE
				SET @zLastInsertId=(
					SELECT IFNULL(
					(MAX(`layout_global_id`) - (MAX(`layout_global_id`) MOD @@auto_increment_increment))+@@auto_increment_increment+(@@auto_increment_offset-1), @@auto_increment_offset)  
					FROM `layout_global` 
					WHERE `layout_global`.site_id = NEW.site_id
				);
				SET NEW.`layout_global_id`=@zLastInsertId;
			END IF;
		END IF;
	END

